    single-beam bathymetry data for field activity K-1-95-HW in in Hawaii from 06/14/1995
    to 06/18/1995",nt"tracking_summary": {ntt"total": 3,ntt"recent":
    1nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2013-09-11T20:09:34.946694",nt"name": "k195hw-m77t-and-k195hw-h77t-mgd77t-data-and-header-files-for-single-beam-bathymetry-dat-18-1995",nt"isopen":
    false,nt"url": null,nt"notes": "Single-beam bathymetry data along with
    DGPS navigation data was collected as part of the U.S. Geological Survey cruise
    K-1-95-HW. The cruise was conducted in Oahu, Hawaii from June 14 to June 18, 1995.
    The chief scientist was Mike Torresan from the USGS Coastal and Marine Geology office
    in Menlo Park, CA. The purpose of this cruise was to conduct an integrated study
    on the distribution and character of dredged materials as well as the effects of
    dredged material on the marine environment. A three phase study provided information
    to evaluate the effects on seafloor substrate and the benthic fauna. The studies
    include geophysical profiling and imaging, bottom photography, sampling, chemical
    and physical analyses of sediment, and evaluations of the benthic population, population
    density, and adverse impacts to the benthic fauna. The geophysical source was an
    ODEC 3.5 kilohertz (kHz) echosounder. These data are reformatted from space-delimited
    ASCII text files located in the Coastal and Marine Geology Program (CMGP) InfoBank
    field activity catalog at http://walrus.wr.usgs.gov/infobank/k/k195hw/html/k-1-95-hw.meta.html
    into MGD77T format provided by the NOAA's National Geophysical Data Center(NGDC).
    The MGD77T format includes a header (documentation) file (.h77t) and a data file
    (.m77t). More information regarding this format can be found in the publication
    listed in the Cross_reference section of this metadata file.",nt"license_title":
